eventScripts.script:
cycles = system.tag.readBlocking(["[.]Cycles"])[0].value
if cycles >= 1500:
	newCycle = 0
else:
	newCycle = cycles+1
system.tag.writeBlocking(["[.]Cycles"], newCycle)

location = system.tag.readBlocking(['[default]Exchange/Prepared Foods Line Demo/Equipment/Freezer/Freezing/FreezingCurveLocation'])[0].value

if location >= 35:
	location = 0
else:
	location += 1

system.tag.writeBlocking(['[default]Exchange/Prepared Foods Line Demo/Equipment/Freezer/Freezing/FreezingCurveLocation'], [location])

